For understanding the EOR kinetics and major product at electrocatalyst surface, the faradaic efficiency (ηF) can be calculated from the average number of electron transferred per ethanol molecule (nav). As it is known that the 12 electron (e−) involved EOR produces CO2 which shows higher ηF and 4e− or 2e− involved EOR produces acetic acid or acetaldehyde which shows lower ηF15,61. The ηF is calculated from the Eq. (1) for all catalysts62 and is shown in Fig. 4e. The ηF is derived much lower at the PdMn-N4/CNTs catalyst than those on all other catalysts. This signifies the higher yield of acetaldehyde and/or acetate with less production of CO2 at the PdMn-N4/CNTs catalyst. However, the higher CO2 production is indicated at the Pt/C electrode during ethanol oxidation in our experiment which is similar to the other report61.1ηF=nav12=∑nifi12\documentclass[12pt]{minimal}
